import React from 'react';
import './HomeCss.css'
const Home = () => {
    return (
        <div class>
            <div className="nav-bar">
                {/* here is our logo section */}
                <div className="logo">
                    <h1>TRIPPY.</h1>
                </div>
                {/* here is our Link Section */}
                <div className="nav-links">
                    <ul>
                        <li><i class="fa-solid fa-house"></i>HOME</li>
                        <li><i class="fa-solid fa-circle-info"></i>ABOUT</li>
                        <li><i class="fa-solid fa-briefcase"></i>SERVICES</li>
                        <li><i class="fa-solid fa-address-book"></i>CONTACT</li>
                    </ul>
                </div>
                {/* login button */}
                <div className="login">
                    <button><i class="fa-solid fa-user"></i>LOGIN</button>
                </div>
            </div>
        </div>
    );
}

export default Home;
